package GeeksForGeeks;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

/*
Given a string S. Count the characters that have ‘N’ number of occurrences. If a character appears consecutively it is counted as 1 occurrence.

        Example 1:

        Input:
        S = "abc", N = 1
        Output: 3
        Explanation: 'a', 'b' and 'c' all have
        1 occurrence.

        â€‹Example 2:

        Input:
        S = "geeksforgeeks", N = 2
        Output: 4
        Explanation: 'g', 'e', 'k' and 's' have
        2 occurrences.*/
public class CountCharacters {

    static int getCount (String S, int N)
    {
        if(S != null){
            HashMap<Character,Integer> hashMap = new HashMap<Character,Integer>();

            for(int i=0;i<S.length();i++){
                if(hashMap.containsKey(S.charAt(i))){
                    int freq = hashMap.get(S.charAt(i));
                    freq = freq + 1;
                        hashMap.put(S.charAt(i),freq);
                }
                else{
                    hashMap.put(S.charAt(i),1);
                }
            }

            int count=0;
            Set<Character> keys = hashMap.keySet();
            for(char c :keys){
                if(hashMap.get(c) == N){
                    count++;
                }
            }
            return count;
        }
        else{
            return -1;
        }
    }

    public static void main(String[] args) {

        System.out.println(getCount("",1131));    }
}
